import React from "react";
import { Link } from "react-router-dom"; // Importa Link de react-router-dom para la navegación 
import '../styles/BotonRegistro.css'; // Importa los estilos CSS para el botón de registro
import { useNavigate } from "react-router-dom"; // Importa useNavigate para la navegación programática

const BotonRegistro = () => {
  const navigate = useNavigate(); // Inicializa el hook useNavigate para la navegación programática
  const handleRegistroClick = () => {   // Función para manejar el clic en el botón de registro
    navigate("/registro"); // Navega a la ruta de registro
  };

  const menuItemsRegistro = [
        { icon: '/assets/icons/casa (1).png', text: 'Home', link: '/' },
        { icon: '/assets/icons/usuario.png', text: 'Perfil', link: '/perfil' },
        { icon: '/assets/icons/usuarios-de-grupo.png', text: 'Equipo', link: '/equipo' },
        { icon: '/assets/icons/rebote.png', text: 'Entrenamiento', link: '/entrenamiento' },
        { icon: '/assets/icons/bolsa-para-la-escuela.png', text: 'Ejercicios', link: '/ejercicios' },
      ];

      return (
        <div>
          {menuItemsRegistro.map((item, index) => (
            <div key={index}>
              <img src={item.icon} alt={item.text} />
              <a href={item.link}>{item.text}</a>
            </div>
          ))}
        </div>
      );
    };

    export default BotonRegistro; // Exporta el componente BotonRegistro para su uso en otras partes de la aplicación
// El componente BotonRegistro es un botón que redirige a la página de registro cuando se hace clic en él.  
// También incluye un menú de navegación con enlaces a diferentes secciones de la aplicación.
// El botón de registro utiliza el hook useNavigate de react-router-dom para la navegación programática.        
// El menú de navegación se genera a partir de un array de objetos que contienen la información de cada elemento del menú.
